import { Box, Button, IconButton, InputAdornment, Modal, Stack, TextField, Typography } from '@mui/material'
import React, { useState } from 'react'
import Theme from '../../Component/Theme';
import { UserTitleBox } from './Login';
import styled from '@emotion/styled';
import { Visibility, VisibilityOff } from '@mui/icons-material';
import SuccessAlert from '../../Component/SuccessAlert';
import ReactDOM from 'react-dom'

const theme=Theme();


const Overly=styled(Stack)(({})=>({
    position:"fixed",
    top:0,
    left:0,
    right:0,
    bottom:0,
    backgroundColor:'rgba(0,0,0, 0.7)',
    zIndex:1000
}))

const ModelStack=styled(Stack)(({})=>({
    zIndex:1000,

}))




const TitleBox=styled(Box)(({theme})=>({
    marginBottom:"30px",
    textAlign:"center",
    width:500,
    [theme.breakpoints.down("md")]:{
        width:350,
    }
}))

const UserText=styled(Stack)(({theme})=>({
    textAlign:"left",
    width:500,
    [theme.breakpoints.down("md")]:{
        width:350,
    }
}))

const UserInputBox=styled(Stack)(({theme})=>({
    textAlign:"left",
    width:500,
    [theme.breakpoints.down("md")]:{
        width:350,
    }
}))

export default function Reset({setReset}) {

    const [showPassword,setShowPassword]=useState(false);

    const [resetPwd,setResetPwd]=useState(true);

    const [alert,setAlert]=useState(false);

    const openAlertSuccess=()=>{
        if(resetPwd){
            setAlert(true);
            setReset(false);
        }
    }

  return ReactDOM.createPortal(
    <ModelStack sx={{
        backgroundColor:theme.palette.background.paper,
        width:600,
        height:725,
        borderRadius:theme.shape.borderRadius,
        overflow:"hidden"
        }}
    >
        <Stack display="flex" direction="row" justifyContent='end'>
                <Button
                    variant="contained" 
                    onClick={()=>setReset(false)}
                ><Typography variant='h5'>X</Typography>
                </Button>
        </Stack>
        <Stack display="flex" direction="column" alignItems="center">
            <TitleBox>
                <Typography variant="h3">Reset Password</Typography>
            </TitleBox>

            <UserText>
                <Typography variant="h6">Password must be:</Typography>
            </UserText>

            <Stack sx={{marginBottom:"20px"}}>
                <ul>
                    <li><Typography variant="h6">Be at least 8 characters long</Typography></li>
                   <li> <Typography variant="h6">Contain at least one uppercase</Typography></li>
                    <li><Typography variant="h6">Contain at least one lowercase</Typography></li>
                    <li><Typography variant="h6">Contain at least one number</Typography></li>
                    <li><Typography variant="h6">Contain at least one special characters</Typography></li>
                </ul>
            </Stack>
            <Stack display="flex" direction="column" spacing={2}>
                                <UserText>
                                    <Typography variant='h5'>Enter New Password</Typography>
                                </UserText>

                                <UserInputBox>

                                    <TextField id="pwd" name="password" variant="outlined" size='small'
                                        type={showPassword? "text":"password"}
                                        sx={{
                                            placeholder:"Enter your password",
                                            size:'small',
                                            width:"100%",
                                            borderRadius:theme.shape.borderRadius,
                                            "&:hover":{
                                                borderBlockColor:theme.palette.success.main
                                            }
                                            }}
                                        InputProps={{

                                                endAdornment: (

                                                <InputAdornment position="end">

                                                    <IconButton

                                                    edge="end"

                                                    onClick={()=>setShowPassword(true)}

                                                    onBlur={()=>setShowPassword(false)}

                                                    >

                                                    {showPassword ? <Visibility /> : <VisibilityOff/>}

                                                    </IconButton>

                                                </InputAdornment>

                                                ),

                                        }}
                                    />
                                </UserInputBox>

                                <UserText>
                                    <Typography variant='h5'>Confirm New Password</Typography>
                                </UserText>

                                <UserInputBox>

                                    <TextField id="pwd" name="password" variant="outlined" size='small'
                                    type={showPassword? "text":"password"}
                                    sx={{
                                        placeholder:"Enter your password",
                                        size:'small',
                                        width:"100%",
                                        borderRadius:theme.shape.borderRadius,
                                        "&:hover":{
                                            borderBlockColor:theme.palette.success.main
                                        }
                                        }}
                                    InputProps={{

                                            endAdornment: (

                                              <InputAdornment position="end">

                                                <IconButton

                                                  edge="end"

                                                  onClick={()=>setShowPassword(true)}

                                                  onBlur={()=>setShowPassword(false)}

                                                >

                                                  {showPassword ? <Visibility /> : <VisibilityOff/>}

                                                </IconButton>

                                              </InputAdornment>

                                            ),

                                    }}
                                    />
                                </UserInputBox>

                            </Stack>

        <Stack justifyContent="center" alignItems="center" sx={{
            marginTop:5,
            width:500,
            [theme.breakpoints.down("md")]:{
                width:350,
            },
        }}
        >
            <Button
                variant="contained" 
                sx={{
                    width:"100%",
                    "&:hover":{
                        backgroundColor:theme.palette.secondary.main,
                    }

                }}
                onClick={openAlertSuccess}
            >
                    <Typography variant='h6'>Reset Password</Typography>
            </Button>
            <Modal
            open={alert}
            aria-labelledby="parent-modal-title"
            aria-describedby="parent-modal-description"
            display="flex"
            justifyContent="center"
            alignItems="center"
            >
                <SuccessAlert setAlert={setAlert}></SuccessAlert>
            </Modal>
        </Stack>
        </Stack>

    </ModelStack>,
    document.getElementById("portal-reset")
  )
}
